function postRestaurants() {
    try {
        for (var i = 0; i < restoData.length; i++) {
            addDoc(collection(db, "restaurants"), restoData[i])
        }
    } catch (e) {
        Swal.fire(e.message)
    }

}
async function getData ()  {
    const querySnapshot = await getDocs(collection(db, "restaurants"));
    const Ads = []
    querySnapshot.forEach((doc) => {
        const data = doc.data()
        data.id = doc.id
        Ads.push(data)
    });
    return Ads
}
function logout() {
    return signOut(auth)
}
async function getSingleRestaurant(restaurants_id) {
    const docRef = doc(db, "restaurants", restaurants_id);
    const docSnap = await getDoc(docRef);

    if (docSnap.exists()) {
        return docSnap.data()
    }
}
